import React, { useState } from 'react';
import MapsPresenter from './MapsPresenter';
import apiService from '../../service/apiService.js';
import {connect} from 'react-redux';

const MapsContainer = (props) => {
    const { data: vesselList } = useAsync({ promiseFn: apiService.callVesselList, locationId:105160 });
    const position = [35.0728, 128.8060];
    const zoom = 14;
    const multiPolygon = [
        [
            [35.07, 128.8075],
            [35.072, 128.8090],
            [35.075, 128.8090],
            [35.075, 128.8060],
            [35.072, 128.8060],
        ],
    ]

    const purpleOptions = { color: 'purple' }
    
    if(props.vesselList){
        vesselList.data = props.vesselList;
    }

    return (
        <MapsPresenter
            position={position}
            zoom={zoom}
            multiPolygon={multiPolygon}
            purpleOptions={purpleOptions}
        />
    );
};

function getVesslList(state) {
    return {
        vesselList : state
    }
}

export default connect(getVesslList)(MapsContainer);
